import React from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Fireworks.module.css';

const CarPage = () => {
  const navigate = useNavigate(); // Corrected to useNavigate
  const cars = [
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/281/548/978/mercedes-benz-amg-gt-car-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/205/711/778/stiletto-car-black-boots-boots-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/906/926/543/bugatti-chiron-sport-bugatti-supercars-car-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/180/1009/141/dodge-dodge-challenger-srt-blue-car-car-dodge-challenger-hd-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/1023/311/684/red-car-car-design-ford-mustang-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/162/85/291/women-redhead-dress-high-heels-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/840/954/346/dark-night-rain-car-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/663/420/862/car-purple-retrowave-landscape-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/522/393/222/car-mercedes-benz-c63-amg-kate-beckinsale-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/268/399/745/women-blonde-high-heels-black-dress-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/193/556/883/car-neon-chevrolet-corvette-race-cars-hd-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/383/154/335/car-khyzyl-saleem-mazda-rx-7-simple-background-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/157/340/999/car-sports-car-supercar-lamborghini-aventador-wallpaper-preview.jpg' },
    { imageUrl: 'https://c4.wallpaperflare.com/wallpaper/404/19/616/dark-car-vehicle-ford-wallpaper-preview.jpg' }
  ];

  const handleLogout = () => {
    navigate('/'); // Use navigate instead of history
  };

  const handleHiddenButtonClick = () => {
    navigate('/hidden'); // Use navigate instead of history
  };

  return (
    <div className={styles.carPage}>
      <button className={styles.logoutButton} onClick={handleLogout}>Logout</button>
      <button className={styles.hiddenButton} onClick={handleHiddenButtonClick}></button>
      <h1>CARS</h1>
      <div className={styles.carList}>
        {cars.map((car, index) => (
          <div className={styles.carCard} key={index}>
            <img src={car.imageUrl} alt={car.name} className={styles.carImage} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default CarPage;
